import React, { useEffect, useRef } from 'react';
import * as d3 from "d3";

import './graph.css'


export const GraphView =() =>{
    const svgRef = useRef();

  useEffect(() => {
    const data = [10, 20, 30, 40, 50];

    const svg = d3.select(svgRef.current);

    svg
      .selectAll('circle')
      .data(data)
      .enter()
      .append('circle')
      .attr('cx', (d, i) => i * 50 + 45)
      .attr('cy', 50)
      .attr('r', (d) => d)
      .style('fill', 'skyblue');
  }, []);

  return <svg ref={svgRef}></svg>;
}
